import React from 'react';
import Pictures from './Pictures';



function Pic() {
    const info = [
        {
            id: 5, img: 'https://picsum.photos/60',
            name: 'omarz',
            work: 'web designer',
            phone: '+49 123456',
            email: 'omarz@gmail.com',
        }

    ]

    return (
        <div className='row'>
            <Pictures p={{
                img: 'https://picsum.photos/60',
                name: 'omarz',
                work: 'web designer',
                phone: '+49 123456',
                email: 'omarz@gmail.com',
            }} />
            <Pictures p={{
                img: 'https://picsum.photos/60',
                name: 'omarz',
                work: 'web designer',
                phone: '+49 123456',
                website: "www.space.com",
            }} />
            <Pictures p={{
                img: 'https://picsum.photos/60',
                name: 'omarz',
                work: 'web designer',
                phone: '+49 123456',
                email: 'omarz@gmail.com',
                website: "www.lol.com",
            }} />
            <Pictures p={{
                img: 'https://picsum.photos/60',
                name: 'omarz',
                work: 'web designer',
                phone: '+49 123456',
                email: 'omarz@gmail.com',
            }} />

        </div>
    )
}

export default Pic;
